import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="App-logo"> 
        <span style={{ display: 'inline-block', width: '100%' }}>LEVEL</span>
        </div>
      </header>
    </div>
  );
}

export default App;
